import styles from './index.module.sass';
import {LayoutContainer} from "../../component/LayoutCointainer";

export const Home = () => {
    return (
        <LayoutContainer>
            <div id="app"></div>
            <a href="https://dribbble.com/shots/3774469-T-R-A-V-E-L-E-R" target="_blank" className="icon-link">
                <img src="http://icons.iconarchive.com/icons/uiconstock/socialmedia/256/Dribbble-icon.png"/>
            </a>
            <a href="https://twitter.com/NikolayTalanov" target="_blank" className="icon-link icon-link--twitter">
                <img src="https://cdn1.iconfinder.com/data/icons/logotypes/32/twitter-128.png"/>
            </a>
        </LayoutContainer>
    )
};
